import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
import AuthPage from "./pages/Auth";

function App() {
  return (
    <BrowserRouter>
      <Route path="/" component={null}></Route>
      <Route path="/auth" component={null}></Route>
      <Route path="/gamesbookings" component={null}></Route>
      <Route path="/bookings" component={null}></Route>

    </BrowserRouter>
  );
}

export default App;
